import React from 'react';
import { Link, Router } from '@reach/router';
import Comments from './Comments';

const Arcticle = () => {
    return (
        <div>
            <h1>Individual Article</h1>
            <p>Article Data here</p>
            <button type="submit"><Link to="/articles">Back</Link></button>
            <Link to="/comments">Comments</Link>
            <Router>
                <Comments path="/aticles/*"/>
            </Router>
        </div>
    );
};

export default Arcticle;
